package com.jlee.leetcodesolutions;

import com.jlee.leetcodesolutions.LeetCode0214;
import org.junit.Assert;
import org.junit.Test;

public class TestLeetCode0214 {
  @Test
  public void testProblemCase1() {
    String s = "aacecaaa";
    LeetCode0214 solution = new LeetCode0214();
    Assert.assertEquals("aaacecaaa", solution.shortestPalindrome(s));
  }

  @Test
  public void testProblemCase2() {
    String s = "abcd";
    LeetCode0214 solution = new LeetCode0214();
    Assert.assertEquals("dcbabcd", solution.shortestPalindrome(s));
  }

  @Test
  public void testProblemCase3() {
    String s = "";
    LeetCode0214 solution = new LeetCode0214();
    Assert.assertEquals(s, solution.shortestPalindrome(s));
  }

  @Test
  public void testProblemCase5() {
    String s = "";
    LeetCode0214 solution = new LeetCode0214();
    Assert.assertEquals(
        "",
        solution.shortestPalindrome(s));
  }
}
